import React, { Suspense } from "react";
import { BrowserRouter as Router, Switch, Route } from "react-router-dom";
import IndexOne from "./pages/IndexOne";
import IndexTwo from "./pages/IndexTwo";
import IndexThree from "./pages/IndexThree";
import IndexFour from "./pages/IndexFour";
import IndexFive from "./pages/IndexFive";
import IndexSix from "./pages/IndexSix";
import Error404Classic from "./pages/error/404-classic";
import Error404Modern from "./pages/error/404-modern";
import Error504Classic from "./pages/error/504-classic";
import Error504Modern from "./pages/error/504-modern";
import Login from "./pages/auth/Login";
import Register from "./pages/auth/Register";
import ForgotPassword from "./pages/auth/ForgotPassword";
import Success from "./pages/auth/Success";

function App() {
  return (
    <Router>
      <Switch>
        <Route path="/pages/auths/auth-login" component={Login} exact />
        <Route path="/pages/auths/auth-register" component={Register} exact />
        <Route
          path="/pages/auths/auth-forgotpassword"
          component={ForgotPassword}
          exact
        />
        <Route path="/pages/auths/auth-success" component={Success} exact />
        <Route
          path="/pages/error/404-classic"
          component={Error404Classic}
          exact
        />
        <Route
          path="/pages/error/404-modern"
          component={Error404Modern}
          exact
        />
        <Route
          path="/pages/error/504-classic"
          component={Error504Classic}
          exact
        />
        <Route
          path="/pages/error/504-modern"
          component={Error504Modern}
          exact
        />
        <Route path="/indextwo" component={IndexTwo} exact />
        <Route path="/indexthree" component={IndexThree} exact />
        <Route path="/indexfour" component={IndexFour} exact />
        <Route path="/indexfive" component={IndexFive} exact />
        <Route path="/indexsix" component={IndexSix} exact />
        <Route path="/" component={IndexOne} exact />
      </Switch>
    </Router>
  );
}

export default App;
